る者の心情を映す「神宿る羊蹄山」は、先住民族の創世記伝説では、世界のはじめは、すべてが海で覆われていたが、その広大な青海原からマチネシリ（羊蹄山）の頂上だけが突き出ていたのだという。その海原から出ていた羊蹄山の山頂に、創造神であるコタンカラカムイが五彩(五色)の雲に乗って降臨し、世界に次々と陸地を作り出していったのだと伝えられています。黒い雲を海に投げ入れ岩を創り、黄色い雲で肥沃な土を創り、青い雲で大地をおおう草木を創り、白い雲で海の魚や貝を創り、赤い雲を大地に埋めて金属や宝石を創ったと言われています。その後、神の意により一羽の梟によって様々な神々が地上にもたらされた。沢山の神々の中で、へケレチュプ（日の神）、クンネチュプ（月の神）という光り輝く美しい神々は、この国（タンシリ）の霧（ウララ）の深く暗い所を照らそうと、羊蹄山の山頂からクンネニシ（黒雲）に乗って天に昇られ、地上の全ての命を慈しみ照らされたと言われています。北海道の祖山である羊蹄山は地球のパワーが噴き出す龍穴とも言われています。先住民族からは、マチネシリ「女の山」と呼ばれ、特に女性の持つエネルギーを高める力があり、女性らしい「優しい心」や「美しさ」を高めてくれる言われています。※羊蹄山の龍脈上にあると言われる、古代の遺物や神社仏閣を探しだし、貴方の祈りで世界の危機を救ってください。 #PowerSpot #パワースポット #Legend  #Japan #北海道 #ニセコ #運命 #幸運 #羊蹄山 #mountain #instadaily #Niseko #hokkaido #ファインダー越しの私の世界 #自然 #nature #mystery #神秘 #amazing #旅行 #祈り #花 #mythology #gardens #御朱印帳 #follow #ガーデニング #神社仏閣 #beautiful #photooftheday 
